import React, { Component } from 'react';
import producs from '../dados/producs';

class Products extends Component {
  render() {
    return (
      <>
        <h1>Aqui vou colocar os produtos</h1>
        <div className="content">
          {producs.map((item) => (
            <div key={item.id} className="card">
              {/* <h4>{`Produto ${item.produto} - Preço R$ ${item.preco}`}</h4> */}

              <div class="info_product">
                <div class="main-wrapper">
                  <h3 class="main-header"> {` ${item.linha} `} </h3>
                  <h1 class="main-title"> {` ${item.produto} `} </h1>
                  <h2 class="main-subtitle">{` R$ ${item.preco} `} </h2>
                </div>
                <div class="main-content">
                  <div class="main-content__title"> {` ${item.destaque}`}.</div>
                  <div class="main-content__subtitle">Perfumes de PITANGA, exuberante e cítrico, também tem o de ALGAS que vai ter transportar para um pôr do sol na praia..</div>
                  {/* <a href="#" class="info-product">
                    Comprar
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" stroke-width="1.7" stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round">
                      <path stroke="none" d="M0 0h24v24H0z" fill="none"></path>
                      <line x1="-5" y1="12" x2="19" y2="12"></line>
                      <line x1="15" y1="16" x2="19" y2="12"></line>
                      <line x1="15" y1="8" x2="19" y2="12"></line>
                    </svg>
                  </a> */}
                </div>
              </div>

            </div>
          ))}
        </div>
      </>
    )
  }
}

export default Products;
